import React from 'react';
import { Button } from "@react-md/button";
import { FontIcon, TextIconSpacing } from "@react-md/icon";

export class C_Button extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Button
            id="icon-button-1"
            buttonType="icon"
            theme="primary"
            aria-label="Favorite"
            >
                <FontIcon>{this.props.icon}</FontIcon>
            </Button>
        )
    }
}

export class C_Icon extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Button 
            icon={this.props.icon} aria-label="More Info" buttonType="icon">
                <FontIcon>{this.props.icon}</FontIcon>
            </Button>
        )
    }
}

export class C_IconText extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Button theme="secondary">
                <TextIconSpacing icon={<FontIcon>{this.props.icon}</FontIcon>}>
                    About
                </TextIconSpacing>
            </Button>
        )
    }
}
